import React from 'react';
import styled from 'styled-components';
// import logo from '../assets/images/tripsoda_icon.png';
import MyComponent from '../component/te2';

export default function Result({ location }) {
    // console.log(location.state.list);
    
    let tatste = 0; // 취향
        let interest = 0; // 관심사
        let re = 0;

        

    let cnt = 0;
    for( let num of location.state.list){
        if(cnt < 5) 
            tatste = tatste + num;
        else if(cnt > 4)
            interest = interest + num;

        cnt++;
    }

    console.log(tatste);
    console.log(interest);
    
    // 내외향성 // 개폐쇄성
    if(tatste < 0 && interest < 0)
    {
        console.log('안정추구');
        re = '안정추구';
    }
    else if(tatste < 0 && interest > 0)
    {
        console.log('경험추구');
        re = '경험추구';
    }
    else if(tatste > 0 && interest < 0)
    {
        console.log('감각추구');
        re = '감각추구';
    }
    else if(tatste > 0 && interest > 0)
    {
        console.log('모험추구');
        re = '모험추구';
    }

    function sendLink() {

        Kakao.init('528314a8da4cb592c76916878dd8af53');
        // // 카카오링크 버튼을 생성합니다. 처음 한번만 호출하면 됩니다.
        Kakao.Link.createDefaultButton({
          container: '#kakao-link-btn',
          objectType: 'feed',
          content: {
            title: '딸기 치즈 케익',
            description: '#케익 #딸기 #삼평동 #카페 #분위기 #소개팅',
            imageUrl: 'http://mud-kage.kakao.co.kr/dn/Q2iNx/btqgeRgV54P/VLdBs9cvyn8BJXB3o7N8UK/kakaolink40_original.png',
            link: {
              mobileWebUrl: 'https://developers.kakao.com',
              webUrl: 'https://developers.kakao.com'
            }
          },
          social: {
            likeCount: 286,
            commentCount: 45,
            sharedCount: 845
          },
          buttons: [
            {
              title: '웹으로 보기',
              link: {
                mobileWebUrl: 'https://developers.kakao.com',
                webUrl: 'https://developers.kakao.com'
              }
            },
            {
              title: '앱으로 보기',
              link: {
                mobileWebUrl: 'https://developers.kakao.com',
                webUrl: 'https://developers.kakao.com'
              }
            }
          ]
        });
      //]]>
        }

    
    return (
        
        <div className='App'>
           {re}
            
        </div>
        
)

};
const ConsultStyled = styled.div`
    max-width: 752px;
    margin: 0 auto;
    width: 100%;
    box-sizing: border-box;
    padding: 0 10px;


    .logo {
        display: flex;
        justify-content: center;
        padding-top: 30px;
    }
`;
